import React from 'react';

type Props = {};

export const Address = (props: Props) => {
  return <div className=' mt-5 border border-gray-400 rounded-lg p-5'>
    
    <section className='flex justify-between'>
        <h1>My Addresses</h1>

        <button className='text-white bg-blue-500 px-3 py-1 rounded-md text-sm'>
            <i className="fas fa-plus"></i> Add New Address
        </button>
    </section>

    <img src="/images/not-found.png" alt="" className='m-auto w-[400px]'/>

  </div>;
};
